INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (1, 'Ticket to Ride', 5, 'https://boardgamegeek.com/boardgame/9209/ticket-ride', '30-60 minutes', 'Build your railroad across North America to connect cities and complete tickets.', 'https://upload.wikimedia.org/wikipedia/en/9/92/Ticket_to_Ride_Board_Game_Box_EN.jpg', 3);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (101, 'Pandemic', 4, 'https://boardgamegeek.com/boardgame/30549/pandemic', '1 hour', 'In Pandemic, several virulent diseases have broken out simultaneously all over the world! The players are disease-fighting specialists whose mission is to treat disease hotspots while researching cures for each of four plagues before they get out of hand.\n\nThe game board depicts several major population centers on Earth. On each turn, a player can use up to four actions to travel between cities, treat infected populaces, discover a cure, or build a research station. A deck of cards provides the players with these abilities, but sprinkled throughout this deck are Epidemic! cards that accelerate and intensify the diseases\' activity. A second, separate deck of cards controls the \"normal\" spread of the infections.\n\nTaking a unique role within the team, players must plan their strategy to mesh with their specialists\' strengths in order to conquer the diseases. For example, the Operations Expert can build research stations which are needed to find cures for the diseases and which allow for greater mobility between cities; the Scientist needs only four cards of a particular disease to cure it instead of the normal five—but the diseases are spreading quickly and time is running out. If one or more diseases spreads beyond recovery or if too much time elapses, the players all lose. If they cure the four diseases, they all win!', 'https://target.scene7.com/is/image/Target/GUEST_0313f621-d762-4e1d-9855-e32163314488?wid=488&hei=488&fmt=pjpeg', 4);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (2, 'Clue', 6, 'https://boardgamegeek.com/boardgame/1294/clue', '45 min', 'Clue is a suspenseful murder mystery game that turns everyone into a detective. There’s been a murder in the Boddy Mansion and it’s up to you to find the culprit. There are only six suspects and you are one of them. Move your game pieces through the rooms and secret passageways of the mansion depicted on the game board to look for clues. Who murdered poor Mr. Boddy? What weapon was used? And where did the incident take place? The more clues you find, the more you will be able to narrow down the many possible answers to those questions. It’s a race against your fellow players to be the first to put all the pieces of this mystery together. No matter your age, it’s always a thrill when you finally solve the crime.', 'https://m.media-amazon.com/images/I/81qrA7eclWL._AC_SL1500_.jpg', 5);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (3, 'Candy Land', 4, 'https://boardgamegeek.com/boardgame/5048/candy-land', '30 minutes', 'The sweet game of Candy Land conjures up fond childhood memories for us. The whimsical board game features landmarks like a candy cane forest and gumdrop mountains and colorful characters like Mr. Mint and Princess Frostine. The premise of Candy Land is simple, making this a game that even the youngest family members can enjoy. King Kandy is lost and the players are in a race to find him. Players take turns drawing from a stack of cards that tell them where to go on the board. Cards indicate the next move by either color for the next square to move to or a picture of a landmark. The first player to reach the end of the board and find King Kandy wins.', 'https://m.media-amazon.com/images/I/91yUG40gv0L._AC_SL1500_.jpg', 3);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (4, 'Monopoly', 8, 'https://boardgamegeek.com/boardgame/1406/monopoly', '2-3 hours', 'The first official Monopoly game hit the market in 1935, and this game of buying property has been creating real estate titans ever since. The board game requires risk and luck, as players buy and trade properties and try to not get thrown in jail. If you have the funds, players are allowed to buy available properties. You can then make income during the game by charging the other players\' rent if they land on any of the spaces that you own. In order to win the game, you have to bankrupt your opponents, which can take a while. The idea is to buy enough property on the same part of the board that you create a monopoly and eventually the other players won’t be able to afford to pay your rent anymore.', 'https://play-lh.googleusercontent.com/O3KYkcY5VuvKh-prh0vMFEN9DJQ5M_cNwoYAqfCdNFfuvknCRfNveN5WYXQ2_4iQWQ', 3);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (5, 'Battleship', 2, 'https://boardgamegeek.com/boardgame/2425/battleship', '30 minutes', 'In this two-person game of strategy, players secretly arrange their ships on a lettered and numbered 10x10 grid and then try to locate and destroy their opponent’s fleet. There are two grids for each player. One grid is used for placing your own vessels and tracking hits made against you, while the second grid is for marking the hits targeted at your opponent. Take turns firing shots by calling out one of the grid’s plot points. If a hit doesn’t strike a ship, it’s considered a miss and pegged with white pieces. If a hit makes contact with a ship, then that strike gets pegged with red. The number of hits each kind of vessel can sustain before it sinks is varied. After some initial exploratory firing, you will likely start to figure out the location of your opponent’s ships and begin to deal the fatal blows. It’s a battle on the high seas!', 'https://images.schoolspecialty.com/images/224154_ecommfullsize.jpg', 3);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (6, 'Settlers of Catan', 4, 'https://boardgamegeek.com/boardgame/13/catan', '1-2 hours', 'Welcome to the beautiful, resource-rich island of Catan. In this award-winning game, you and your fellow players are settlers on the island working to build up your settlements and cities. Different parts of the island provide different resources and you will have to barter and trade with your opponents to get what you need. The game board is made up of 19 different hexagonal tiles that allow for a different layout each time, so no two games are the same. Accrue victory points for various cultural achievements—for example, 1 point for a settlement, 2 points for having the largest army. Players keep their victory cards concealed during play to throw off opponents as the first one to reach 10 victory points wins. Catan is a game of strategy that is suitable for both adults and older kids.', 'https://media.wired.com/photos/59327a635c4fbd732b55301b/master/pass/Settlers-of-Catan-21.jpg', 4);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (7, 'Risk', 6, 'https://boardgamegeek.com/boardgame/181/risk', '2 hours', 'Feel what it’s like to rule the world in a game of Risk. In this game, a map of the world is spread out on the game board, and all of the continents are broken up into territories. The end goal is for one player to conquer all 42 territories and eliminate the other players along the way. But first, a little diplomacy is required to get there. Make alliances (and then break alliances) as you slowly start to conquer more territory, but be cautious—if you’re willing to break an alliance, then you know your opponents will be, too. We should add a time warning on this one, as a complete game of Risk can last upward of a few hours. Nobody ever said total world domination would happen quickly.', 'https://m.media-amazon.com/images/I/91s9x1RHbtL._AC_SX569_.jpg', 4);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (8, 'Axis & Allies', 5, 'https://boardgamegeek.com/boardgame/98/axis-allies', '3 hours', 'Axis & Allies is another exciting military-strategy board game. It’s great fun for history buffs as it’s based on World War II, but throughout game play the course of history can be altered. Players represent the Axis powers and the Allied powers, and in every turn get to make both combat and non-combat moves across the globe as well as decide what military units to build and whether or not to fund research. If you haven’t played before, definitely read through the rules first—there are a lot of moving parts to keep track of. Depending on the agreed-upon end goal, the aim is for your powers to have control of 13-18 of the victory cities. It’s worth noting here that a game of Axis & Allies can last a while—as in multiple hours. Will the Allied or Axis powers prevail? (And if you’re interested, check out The Man in The High Castle to see how the latter might have turned out.)', 'https://www.axisandallies.org/forums/assets/uploads/files/1542122384553-img_20181110_142202.jpg', 4);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (9, 'Chess', 2, 'https://boardgamegeek.com/boardgame/171/chess', '30-60 minutes', 'When a game has endured as long as Chess has (we’re talking nearly 1,500 years!) you know it’s worth playing. In this classic two-player game, you and your opponent have the same 16 pieces to maneuver across a 64-square game board, with the ultimate goal being to checkmate your opponent’s king piece. Game pieces consist of pawns, rooks, bishops, knights, a queen, and a king, and there are different rules about how each piece can move. We think it’s helpful to keep a cheat sheet handy. The best piece of advice we can give for this game is to take a step back and assess the whole situation before making a big move. Turns out, Chess is also a pretty good metaphor for life.', 'https://images.ctfassets.net/usf1vwtuqyxm/6ZxCoUx3FeSsm6gEsgmuWi/42352a8184b09d159f709ad1e40c24a7/WB_F1_WizardsChess_HarryRonHermioneCrossingBoard_8637.jpg?fm=jpg&q=70&w=2560', 5);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (10, 'Blokus', 4, 'https://boardgamegeek.com/boardgame/2453/blokus', '20 minutes', 'For a quick game of strategy, we recommend Blokus—it’s like Tetris with a twist. Each player is given a set of 21 tiles in a specific playing color, and every tile in that set is a different geometric figure. To start the game, each player places the tile of his or her choosing in one of the corners of the 400-square game board. As play continues, it grows increasingly tricky to place your tiles on the board. Tiles of the same color are only allowed to touch at one corner, while tiles of different colors may share sides. With every move, you’ll want to size up the tiles remaining in your set to determine which of those shapes will best fit into the available spaces. Try to play all 21 of your tiles to win Blokus.', 'https://c.shld.net/rpx/i/s/i/spin/image/spin_prod_113306901?', 5);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (11, 'Jenga', 8, 'https://boardgamegeek.com/boardgame/2452/jenga', '20 minutes', 'We love Jenga for its ease of play. The rules are simple and straightforward, and whether you’re playing solo or with a whole group of folks, this game is always full of suspenseful fun. Setup is quick. Build a tower from the 54 small wooden blocks provided—three blocks wide by 18 blocks high. Players then take turns removing one block from within the tower and placing it back on the top. Cross your fingers and hold your breath as the tower grows taller and more unstable with every move. See how many rounds you can go before the tower comes crashing down. The last person to successfully place a block before the tower tumbles is considered the winner.', 'https://qvc.scene7.com/is/image/QVC/t/88/t131588.001', 5);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (12, 'Mastermind', 2, 'https://boardgamegeek.com/boardgame/2392/mastermind', '20 minutes', 'If you or your kiddos like cracking codes, then you’ll love the game of Mastermind. In each round of this two-person game, one player gets to create the code and the other player tries to crack it. Using any combination of the six colors provided, the codemaster secretly creates a code that is comprised of just four pegs. The second player then begins a guess-and-check process to figure out the code by placing a series of any four pegs onto the board. After the first guess, the codemaster provides feedback for any pegs that are accurately placed or any pegs that are the right color but in the wrong spot. The second player then guesses again by placing a second row of pegs, and the process continues until either the code is cracked or the second player runs out of guesses.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSoCFjZYvs_BFqz7RyWggglarQiCU-25hiYcwYWSxHBIzXLgaOgQqabZxbrg6mpunx7WNU&usqp=CAU', 6);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (13, 'Sorry!', 4, 'https://boardgamegeek.com/boardgame/2407/sorry', '30 minutes', 'Move your four pawns around the board and safely navigate them home again in the game of Sorry. All pawns begin in their respective start spaces, and players take turns drawing from a deck of 44 cards to see what the pawn’s next move might be. Sorry is a competition, and there are two ways to set back your opponents. Similar to the game Trouble, if you land on a space that is already occupied by another player’s pawn, that pawn is sent back to the start. The second way to create a setback is by drawing one of the deck’s four “Sorry” cards. If this happens, you can select any one of your opponents’ pawns to return to start, except a pawn in a safety zone. Win by being the first to get all four of your pawns home. Psst! A scoring system exists if you wish to play multiple rounds of this game.', 'https://images.heb.com/is/image/HEBGrocery/001669716', 6);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (14, 'Trouble', 4, 'https://boardgamegeek.com/boardgame/1410/trouble', '45 minutes', 'In Trouble, the goal is to be the first player to get all four of your pieces around the board and back home again. The premise is simple, but there are challenges along the way. Game play is controlled by a die, but it’s not just rolled by hand—no, no—to roll the die in Trouble, you get to press the plastic dome on the game’s cool pop-o-matic dice roller. For a piece to leave home base, you first have to roll a six. After that, pieces can advance normally based on the die roll. With 28 spots on the game board, it can start to get crowded when all 16 pieces are in play, and that’s where the trouble can begin. If another player lands on a spot occupied by one of your pieces, your piece is sent back to home base and has to start the process again.', 'https://cdn.shopify.com/s/files/1/0061/5635/3607/products/winning-moves-classic-trouble-game-1176-m_460x460.jpg?v=1581359241', 6);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (15, 'Uno', 7, 'https://boardgamegeek.com/boardgame/2223/uno', '30 minutes', 'All you need to play this fun family game is the Uno card deck. There are no other marbles, spinners, or game pieces required, which makes this quick to clean up and great to take on the go. An Uno deck contains 108 cards—25 cards each in one of four colors, plus 8 special action cards (like Skip and Reverse). Players take turns matching a card from their hand by number or color to the card in the middle of the game. Players replenish their hands by pulling from the “draw” deck until there are no cards remaining. When a player has just one card left they get to call out “Uno!” as a warning to the other players, which, in our opinion, is one of the best parts of the game. That, and the obligatory victory dance after you win.', 'https://m.media-amazon.com/images/I/71-1gqPVCuL._AC_SL1500_.jpg', 100);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (16, 'Chutes and Ladders', 6, 'https://boardgamegeek.com/boardgame/5432/chutes-and-ladders', '30 minutes', 'It’s a race to the finish in this classic childhood game where good deeds take you far, and naughty behaviors will set you back. The Chutes and Ladders game board contains 100 squares and depicts a series of ladders and slides. Each ladder represents a good deed and its reward, but every slide represents the consequences of bad behavior. Every player starts in the first square and a spinner dictates how many spaces a player can advance from there. If you’re lucky, you’ll land at the base of a good-deed ladder, which you can climb, advancing extra spaces. But if you’re not so lucky, you’ll land at the top of a slide and have to go down, which will set you back quite a bit. The first player to the 100 square wins.', 'https://m.media-amazon.com/images/I/71a7GQpOv+L._AC_SL1500_.jpg', 44);
INSERT INTO `game` (`id`, `name`, `max_players`, `link_to_game`, `time_to_play`, `description`, `image_url`, `user_id`) VALUES (17, 'Yahtzee', 10, 'https://boardgamegeek.com/boardgame/2243/yahtzee', '30-60 minutes', 'We love that there’s no limit to how many people can play the fun game of Yahtzee, the dice game where it’s all up to the luck of the roll. Each round, players receive three opportunities to roll up to five dice. After each roll, you can evaluate the dice and choose which, if any, you want to roll again. You are looking for a pattern that will work for one of the 13 possible Yahtzee categories. At the end of your turn, choose which category you will use for that round and tally the score accordingly. You can only use a category once per game, so choose carefully. If you land all five dice on the same number, it’s called a Yahtzee (feel free to shout it out). At 50 points, a Yahtzee is the highest possible score you can roll. Play up to 13 rounds and then tally your scores; the player with the highest score wins.', 'https://www.boardgamehalv.com/wp-content/uploads/2020/08/Yahtzee_BoardGame.jpg', 32);
